// src/components/dashboard/StatsCard.jsx
import React from "react";

const StatsCard = ({ prediction }) => {
  if (!prediction) return null;

  return (
    <div className="p-4 bg-white rounded shadow mb-6">
      <h2 className="text-xl font-semibold mb-2">Your Latest CVD Risk Prediction</h2>
      <p>
        <strong>Risk Percentage:</strong> {prediction.risk_percentage}%
      </p>
      <p>
        <strong>Risk Category:</strong> {prediction.risk_category}
      </p>
      <p>
        <strong>Predicted At:</strong> {new Date(prediction.predicted_at).toLocaleString()}
      </p>
    </div>
  );
};

export default StatsCard;
